  void dispose() {
    usernameTextEditingController.dispose();
    passwordTextEditingController.dispose();
    newPasswordTextEditingController.dispose();
    secretWordsTextEditingController.dispose();
    super.dispose();
  }

  @override
  Widget build(BuildContext context) {
    return Scaffold(
      appBar: AppBar(
        centerTitle: true,
        title: Text(signPageType.title()),
      ),
      body: RefreshIndicator(
        onRefresh: () async {},
        color: context.theme.indicatorColor,
        child: SingleChildScrollView(
          physics: const BouncingScrollPhysics(),
          child: ConstrainedBox(
            constraints: BoxConstraints(
              minHeight: context.height,
              minWidth: context.width,
            ),
            child: Column(
              mainAxisAlignment: MainAxisAlignment.center,
              children: [
                usernameFieldWidget(),
                if (signPageType == SignPageType.sign_in) ...[
                  passwordFieldWidget(),
                ] else ...[
                  newPasswordFieldWidget(),
                ],
                Container(
                  width: context.width,
                  margin: const EdgeInsets.all(10),
                  decoration: BoxDecoration(
                    color: context.theme.primaryColor,
                    borderRadius: BorderRadius.circular(10),
                  ),
                  clipBehavior: Clip.antiAlias,
                  child: MaterialButton(
                    onPressed: () {
                      signButton();
                    },
                    child: Padding(
                      padding: const EdgeInsets.all(10),
                      child: Text(signPageType.title()),
                    ),
                  ),
                ),
                SizedBox(
                  height: context.mediaQueryData.padding.bottom,
                ),
              ],
            ),
          ),
        ),
      ),
    );
  }

  Widget usernameFieldWidget() {
    return Padding(
      padding: const EdgeInsets.all(10),
      child: TextFormFieldGeneralFrameworkWidget(
        prefixIconData: Icons.person,
        controller: usernameTextEditingController,
        labelText: "Username",
        hintText: "username",
        onChanged: (value) {},
      ),
    );
  }

